import React from 'react';
import './ContactUs.css';

const ContactUs = () => {
    return (
        <section className="contact-us">
            <h2>Contact Us</h2>
            <div className="contact-info">
                <p>If you have any questions or need further assistance, please reach out to us:</p>
                <p><strong>Phone:</strong> +91 9608632246</p>
                <p><strong>Email:</strong> <a href="mailto:ayuthakur231@gmail.com">ayuthakur231@gmail.com</a></p>
            </div>
        </section>
    );
};

export default ContactUs;
